(2) Please, enable the data download feature for each of the embedded dashboard views.

@JoanneSalchert @dougducey @kathyhoffman_az @drcarachrist @az_reason @EthicalSkeptic @Hold2LLC @azcentral Sorry Joanne, this isn't a great article.

It doesn't stick to the facts and the quotes are not accurate.  It isn't backed by data and epidemiology.  We need to use data to guide decisions to prevent deaths and disabilities.
#STEMeducation

